import "./ChooseTrip.css";
const ChooseTrip = () =>{

    return(
        <div cla>
            
            <div className="centre">
            <div>
                <button className="btn">Join Trip</button>
            </div>
            <div>
                <button className="btn">Plan Trip</button>
            </div>
        </div>
        </div>
        
    )
}

export default ChooseTrip;
